use core::any;
use core::fmt;
use core::ops;

use opaque_vec_testing as ovt;

fn run_test_array_alternating<T, const N: usize>(this: T, that: T, expected: [T; N])
where
    T: any::Any + Copy + PartialEq + Clone + fmt::Debug + TryFrom<usize> + ops::Add<Output = T>,
    <T as TryFrom<usize>>::Error: fmt::Debug,
{
    let result = ovt::alternating_values(ovt::AlternatingValuesSpec::new(this, that));

    assert_eq!(result, expected);
}

macro_rules! generate_tests {
    ($typ:ident, $( $test_name:ident :: $array_length:expr => $this_value:expr => $that_value:expr => $expected:expr ),* $(,)?) => {
        mod $typ {
            $(
                #[test]
                fn $test_name() {
                    let this_value: $typ = $this_value;
                    let that_value: $typ = $that_value;
                    let expected: [$typ; $array_length] = $expected;
                    super::run_test_array_alternating::<$typ, $array_length>(this_value, that_value, expected);
                }
            )*
        }
    };
}

